import React, {ReactNode} from "react";
import Divider from "../General/Divider";

class LobbyDivider extends React.Component<any, any> {
    public render(): ReactNode {
        return (
            <Divider
                className={'col-lg-6 col-md-6 col-sm-6 col-xs-12 col-xs-6 mt-5 mb-2 ml-4'}
            />
        );
    }
}

export default LobbyDivider;
